docs/guides/tape-ava.html.body:
Using enzyme with Tape and AVA
enzyme works well with Tape and AVA.
Simply install it and start using it:
npm i --save-dev enzyme enzyme-adapter-react-16

Tape
import test from 'tape';
import React from 'react';
import { shallow, mount, configure } from 'enzyme';
import Adapter from 'enzyme-adapter-react-16';

import Foo from '../path/to/foo';

configure({ adapter: new Adapter() });

test('shallow', (t) => {
  const wrapper = shallow();
  t.equal(wrapper.contains(Foo), true);
});

test('mount', (t) => {
  const wrapper = mount();
  const fooInner = wrapper.find('.foo-inner');
  t.equal(fooInner.is('.foo-inner'), true);
});

