This essentially calls wrapper.prop(propName)(...args).
Returns
ReactWrapper: A new wrapper that wraps the node returned from the render prop.
Examples
Test Setup
class Mouse extends React.Component {
  constructor() {
    super();
    this.state = { x: 0, y: 0 };
  }

  render() {
    const { render } = this.props;
    return (
       {
          this.setState({
            x: event.clientX,
            y: event.clientY,
          });
        }}
      >
        {render(this.state)}

    );
  }
}

Mouse.propTypes = {
  render: PropTypes.func.isRequired,
};

const App = () => (

     (

          The mouse position is ({x}, {y})

      )}
    />

);

Testing with no arguments
const wrapper = mount()
  .find(Mouse)
  .renderProp('render')();

expect(wrapper.equals(The mouse position is 0, 0)).to.equal(true);

Testing with multiple arguments
const wrapper = mount()
  .find(Mouse)
  .renderProp('render')(10, 20);

expect(wrapper.equals(The mouse position is 10, 20)).to.equal(true);

docs/api/ReactWrapper/setContext.html.body:
.setContext(context) => Self
A method that sets the context of the root component, and re-renders. Useful for when you are
wanting to test how the component behaves over time with changing contexts.
NOTE: can only be called on a wrapper instance that is also the root instance.
Arguments

context (Object): An object containing new props to merge in with the current state

Returns
ReactWrapper: Returns itself.
Example
import React from 'react';
import PropTypes from 'prop-types';

function SimpleComponent(props, context) {
  const { name } = context;
  return {name};
}
SimpleComponent.contextTypes = {
  name: PropTypes.string,
};

const context = { name: 'foo' };
const wrapper = mount(, { context });
expect(wrapper.text()).to.equal('foo');
wrapper.setContext({ name: 'bar' });
expect(wrapper.text()).to.equal('bar');
wrapper.setContext({ name: 'baz' });
expect(wrapper.text()).to.equal('baz');

Common Gotchas

.setContext() can only be used on a wrapper that was initially created with a call to mount()
that includes a context specified in the options argument.
The root component you are rendering must have a contextTypes static property.

Related Methods

.setState(state[, callback]) => Self
.setProps(props[, callback]) => Self

docs/api/ReactWrapper/setProps.html.body:
.setProps(nextProps[, callback]) => Self
A method that sets the props of the root component, and re-renders. Useful for when you are
wanting to test how the component behaves over time with changing props. Calling this, for
instance, will call the componentWillReceiveProps lifecycle method.
Similar to setState, this method accepts a props object and will merge it in with the already
existing props.
NOTE: can only be called on a wrapper instance that is also the root instance.
Arguments

nextProps (Object): An object containing new props to merge in with the current props
callback (Function [optional]): If provided, the callback function will be executed once setProps has completed

Returns
ReactWrapper: Returns itself.
Example
import React from 'react';
import PropTypes from 'prop-types';

function Foo({ name }) {
  return (

  );
}
Foo.propTypes = {
  name: PropTypes.string.isRequired,
};

const wrapper = mount();
expect(wrapper.find('.foo')).to.have.lengthOf(1);
expect(wrapper.find('.bar')).to.have.lengthOf(0);
wrapper.setProps({ name: 'bar' });
expect(wrapper.find('.foo')).to.have.lengthOf(0);
expect(wrapper.find('.bar')).to.have.lengthOf(1);

import sinon from 'sinon';

const spy = sinon.spy(MyComponent.prototype, 'componentWillReceiveProps');

const wrapper = mount();
expect(spy).to.have.property('callCount', 0);
wrapper.setProps({ foo: 'foo' });
expect(spy).to.have.property('callCount', 1);

